s($,"b9P","aSf",()=>A.oJ(B.hw,$.a20(),A.b([A.eP(A.b(["C++\uc740 \uc8fc\ub825 \uc5b8\uc5b4\ub294 \uc544\ub2c8\uc9c0\ub9cc, \uae30\ubcf8 \uc774\uc0c1\uc758 \ub2a5\ub825\uc73c\ub85c \ud65c\uc6a9\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. C++ \ub85c\uc9c1\uc744 \ub3d9\uc801 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub85c \uc791\uc131\ud574 \ub2e4\ub978 \uad00\ub9ac\ud615 \uba54\ubaa8\ub9ac \ub7f0\ud0c0\uc784\uacfc \uc0c1\ud638\uc791\uc6a9\ud558\uba70, \ud3ec\uc778\ud130\ub97c \ud1b5\ud574 \uac1d\uccb4\ub97c \uacf5\uc720\ud558\uace0 \ub370\uc774\ud130\ub97c \ucc98\ub9ac\ud558\ub294 \ubc29\uc2dd\uc73c\ub85c \uc791\uc5c5\uc744 \uc218\ud589\ud55c \uacbd\ud5d8\uc774 \uc788\uc2b5\ub2c8\ub2e4. Python\uc5d0\uc11c\ub294 FFI(Foreign Function Interface)\ub97c \ud65c\uc6a9\ud558\uace0, C#\uc5d0\uc11c\ub294 P/Invoke\ub97c \uc0ac\uc6a9\ud558\uc5ec C++ \ucf54\ub4dc\uc640 \uc0c1\ud638\uc791\uc6a9\ud55c \uacbd\ud5d8\ub3c4 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub7ec\ud55c \uacbd\ud5d8\ub4e4\uc740 \ub2e4\uc591\ud55c \ud658\uacbd\uc5d0\uc11c C++\uc758 \uc131\ub2a5\uc744 \ud65c\uc6a9\ud55c \ub370\uc774\ud130 \ucc98\ub9ac\uc5d0 \ud070 \ub3c4\uc6c0\uc774 \ub418\uc5c8\uc2b5\ub2c8\ub2e4.","\uc774 \uacfc\uc815\uc5d0\uc11c \uad6c\uc870\uccb4\uc758 \uba54\ubaa8\ub9ac \uc815\ub82c\uacfc \ud328\ub529\uc744 \uace0\ub824\ud574\uc57c \ud588\uace0, \uc774\ub97c \uacf5\uc720\ud558\ub294 \uad6c\uc870\uccb4\ub97c \uac01 \uc5b8\uc5b4\uc5d0\uc11c \ub3d9\uc77c\ud558\uac8c \uc815\uc758\ud574\uc57c \ud55c\ub2e4\ub294 \uc810\uc744 \uc54c\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \ub610\ud55c, \ud0c0\uc785\uc744 \ub9de\ucd9c \ub54c \uc800\uc218\uc900\uc5d0\uc11c \uac19\uc740 \ube44\ud2b8\uc640 \ubd80\ud638\ub97c \uac00\uc9c0\ub3c4\ub85d \uc77c\uce58\uc2dc\ud0a4\ub294 \uac83\ub3c4 \ub9e4\uc6b0 \uc911\uc694\ud588\uc2b5\ub2c8\ub2e4. \uc774\ub7ec\ud55c \uba54\ubaa8\ub9ac \uad00\ub9ac\uc640 \uad6c\uc870\uccb4 \uc815\uc758\uc758 \uc77c\uad00\uc131\uc744 \uc720\uc9c0\ud558\ub294 \uac83\uc774 \ubc14\uc778\ub529 \uacfc\uc815\uc5d0\uc11c \uc911\uc694\ud55c \uacfc\uc81c\uc600\uc73c\uba70, \uc774\ub97c \ud1b5\ud574 \uc5ec\ub7ec \uc5b8\uc5b4 \uac04\uc758 \uc0c1\ud638 \uc6b4\uc6a9\uc131\uc744 \ud655\ubcf4\ud560 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.","\ub610\ud55c, Tesseract\uc758 C, C++ \uc18c\uc2a4 \ube4c\ub4dc\ub97c \uc704\ud574 vcpkg\uc640 CMake\ub97c \uc0ac\uc6a9\ud55c \uacbd\ud5d8\ub3c4 \uc788\uc2b5\ub2c8\ub2e4."],t.s),null)],t.Yg),B.dH,4))
